import React, { Component } from 'react';
import './App.css';
import { firestore } from './firebase';

class App extends Component {
  state = {
    name : "123"
  }

  getName(){
    firestore.collection("test")
    .doc("test")
    .get()
    .then(doc => {
      this.setState({
        name : doc.data().test
      })
    })
  };

  render(){
    return (
      <div className = "App">
        <h1>ddddd</h1>
        <h1> {this.state.name} </h1>
      </div>
    );
  }
}
